import React from 'react';
import {Link } from 'react-router-dom';




const NavComponent = () => {
return (
<nav className="nav-extended">
    <div className="nav-wrapper">


            <Link to="/home" className="brand-logo" >Home</Link>

            <div class="nav-content">
            <ul class="tabs tabs-transparent">
            <ul className="right">
            <li className="tab"><Link to="/" className="nav-list">Healing Circle</Link></li>
            <li className="tab"><Link to="/create" className="nav-list">Heal Request</Link></li>
            <li className="tab"><Link to="/user" className="nav-list">Create Healer</Link></li>

            <li className="tab"><Link to="/instructions" className="nav-list">Instructions</Link></li>

           {/*
            <li><Link to="/healrequestform" >Heal Request</Link></li>
            <li><Link to="/circle" >Healing Circle</Link></li>


            <li><Link to="/createaccount" >Login</Link></li>
            */}

            </ul>
            </ul>
            </div>
    </div>    
</nav>
);

};

export default NavComponent;
